def replace_tokens(content, usernameList=None, projectnameList=None):
    # 过滤用户昵称 eg. @username、username:
    if usernameList != None:
        users = ""
        for username in usernameList:
            users += username + '|'
        users = users[:-1]
        users = r'(@\s?(' + users + ')\\b)'+'|'+'(\\b(' + users + ')\s?:)' + '|' +'(\\b(' + users + ')\\b)'
        #print(users)
        content = re.sub(users, ' user ', content)
    # 过滤项目领域特定词 eg.gitlab、angularjs
    if projectnameList != None:
        for projectname in projectnameList:
            content = re.sub(projectname, ' project ', content)

    # #去除html格式
    # content = BeautifulSoup(content, 'lxml').get_text()
    # 替换转义符号
    content = re.sub(r'\\([\'\"])\1', r"\1", content)
    content = re.sub(r"\\n", " ", content)
    # 处理缩写词
    content = contractions.fix(content)



    # 过滤表情符号eg. :)、:P、:-) -----情感分析时可保留
    content = re.sub(r'\s([:;,\-=]([\-=_])*[)DPdp(])|([\-^=o0]\.[\-^=o0])|(:-/)|(\^\^)', '', content)

    content = re.sub("\[<-CODE->\]", " code ", content)
    content = re.sub("\[<-LINK->\]", " link ", content)
    content = re.sub("\[<-ISSUE->\]", " issue ", content)
    # 替换URL
    content = re.sub(r"http\S+\s", ' url ', content)
    # 替换email
    content = re.sub(r'^[0-9a-zA-Z_]{0,19}@[0-9a-zA-Z]{1,13}\.[com,cn,net]{1,3}$', ' email ', content)
    # 替换代码
    content = re.sub(r"'''.*'''", " code ", content)
    content = re.sub(r'{.*}', " code ", content)
    content = re.sub(r"\[.*\]", " ", content)
    #替换目录
    content = re.sub(r"(\s(\S+[\\/]){2,}\S*)|(\s([\\/]\S+){2,}[\\/]?\S*\s?)", " directory ", content)
    # 替换类名
    content = re.sub(r"\s([A-Za-z]+[.]){2,}[A-Za-z]+\s?", " class ", content)
    # 替换版本id
    content = re.sub(r"\s([0-9]+[.]){2,}[0-9]+\s?", " vid ", content)
    content = re.sub(r'([Vv]?[0-9]+(\.[0-9xX]+)+[VvxX]?)|[Vv][0-9]', ' vid ', content)
    # 替换hash_id
    content = re.sub(r'#\d+\s', ' hid ', content)
    # 过滤重复达到三次的错误拼写的字母
    content = re.sub(r'([a-zA-Z])\1{2,}', r'\1', content)
    # 过滤重复的标点符号和空格符
    content = re.sub(r'([.!?\s])\1{1,}', r'\1', content)
    # 去除代码符号
    content = re.sub(r'[~@#$%^&*_+`|\-=]', ' ', content)
    # 去除数字
    content = re.sub(r'[0-9]', '', content)
    return content.strip()

def lemmatize_all(sentence):
    sen = []
    wnl = WordNetLemmatizer()
    for word, tag in pos_tag(word_tokenize(sentence)):
        if tag.startswith('NN'):
            word = wnl.lemmatize(word, pos='n')
        elif tag.startswith('VB'):
            word = wnl.lemmatize(word, pos='v')
        elif tag.startswith('JJ'):
            word = wnl.lemmatize(word, pos='a')
        elif tag.startswith('R'):
            word = wnl.lemmatize(word, pos='r')
        else:
            word = wnl.lemmatize(word)

        if len(word)>=2 and len(word)<=15:
            sen.append(word)
    return sen


def split_sen(content):
    tokenizer = nltk.data.load('tokenizers/punkt/english.pickle')
    content_list = tokenizer.tokenize(content)
    for index in range(len(content_list)):
        #去除剩余的标点符号
        content_list[index] = re.sub(r'[!\\"#$%&\'()*+,\-./:;<=>?@[\]^_`{|}~]',
                                     ' ', content_list[index].lower())
    return content_list

